import React from 'react'
import ReactDOM from 'react-dom';
import  {Add}  from './App';
import  {Sub}  from './App';
import  {Mul}  from './App';
import  {Div}  from './App';



ReactDOM.render(

    <>
        <ul>

            <span>Sum Is : {Add(10,6)}</span>
            <br/>
            <span>Sub Is : {Sub(10,6)}</span>
            <br/>
            <span>Mul Is : {Mul(10,6)}</span>
            <br/>
            <span>Div Is : {Div(10,6)}</span>
            <br/>

        </ul>

    </>,
    document.getElementById('root')
);
